// ignore_for_file: non_constant_identifier_namesimport 'package:equatable/equatable.dart';class Contacts  extends Equatable {  Contacts._();  Contacts.fromJson(dynamic json) {    id = json['id'];    phone = json['phone']??'';    address_ru = json['address_ru'];    address_uz = json['address_uz'];    address_en = json['address_en'];    work_uz = json['work_uz'];    work_ru = json['work_ru'];    work_en = json['work_en'];    email = json['email'];  }  late  int id;   String phone = '';   String email = '';  late  String address_ru;  late  String address_uz;  late  String address_en;  late  String work_ru;  late  String work_uz;  late  String work_en;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};          map['id'] = id;         map['phone'] = phone;    map['email'] = email;    map['address_ru'] = address_ru;    map['address_uz'] = address_uz;    map['address_en'] = address_en;    map['work_uz'] = work_uz;    map['work_ru'] = work_ru;    map['work_en'] = work_en;    return map;  }  @override  List<Object?> get props => [id,phone,email,address_uz,address_ru,    address_en,work_ru,work_uz,work_en];}